text:
❤️感謝楊小姐分享～
六字大明咒“嗡瑪尼貝美吽”非常殊勝。修持它的意義，就是修持六度。

 嗡，能圓滿布施度;
瑪，能圓滿持戒度;
尼，能圓滿忍辱度;
貝，能圓滿精進度;
美，能圓滿禪定度;
吽，能圓滿智慧度。


平常虔誠專一修持六字大明咒，即是在修持六度。我們的傳承中，是持誦“嗡瑪尼貝美吽啥”，“啥”為種子字，實為觀音菩薩身口意所有一切事業之功德，能使我們得到觀音菩薩的巨大加持，慢慢將我們的身口意，變成觀音菩薩的身口意。

 六字大明咒，能幫我們堵住六道之門，避免我們墮入六道輪迴。

 嗡，讓人免於投胎到天界，並讓天道的眾生有機會獲得解脫;
瑪，讓人免於投胎入阿修羅道，並使阿修羅道的眾生有機會獲得解脫;
尼，讓人免於投胎到人道，讓人道的眾生有機會獲得解脫;
貝，讓人免於投胎到餓鬼道，讓餓鬼道的眾生有機會獲得解脫;
美，讓人免於投胎到畜牲道，讓畜生道的眾生有機會獲得解脫;
吽，讓人免於投胎到地獄道，讓地獄道的眾生有機會獲得解脫。
